import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    const func1 = () => console.log('Você clicou no botão 1');

    return (
      <div className="App">
        <button onClick={ func1 }>Botão 1</button>
        <button onClick={ console.log('Você clicou no botão 2') }>Botão 2</button>
        <button onClick={ console.log('Você clicou no botão 3') }>Botão 3</button>
      </div>
    );
  }
}

export default App;
